ISLAMABAD, June 16 (APP): Members of the Parliament called on Prime Minister Imran Khan here on Wednesday and discussed matters relating to their constituencies as well as the progress of ongoing development projects.
Those who called on the Prime Minister included Special Assistant to PM on Political Affairs Malik Amir Dogar, Senator Mohsin Aziz, Members of the National Assembly (MNAs) Muhammad Asim Nazir, Amir Liaquat Hussain, Ramesh Kumar, Haji Imtiaz Ahmad Chaudhry and ex-MNA Ejaz Chaudhry.
